def starts_one_ends(n):
    """
    Given a positive integer n, return the count of the numbers of n-digit
    positive integers that start or end with 1.
    """
    if n == 1:
        return 2  # 1 and 10
    else:
        # For n-digit numbers, there are 10^(n-1) numbers that start with a particular digit
        # and 10^(n-1) numbers that end with a particular digit.
        # So, there are 2 * 10^(n-1) numbers that start or end with 1.
        # But this counts twice the numbers that start and end with 1, so we subtract 10^(n-2).
        return 2 * 10**(n-1) - 10**(n-2)

