    i starts from 1.
    the factorial of i is the multiplication of the numbers from 1 to i (1 * 2 * ... * i).
    Example:
    f(5) == [1, 2, 6, 24, 15]
    """
    def factorial(i):
        if i == 0 or i == 1:
            return 1
        else:
            return i * factorial(i - 1)

    def sum_numbers(i):
        return sum(range(1, i + 1))

    return [factorial(i) if i % 2 == 0 else sum_numbers(i) for i in range(n)]

