print(order_by_points([1, 11, -1, -11, -12]))  # [-1, -11, 1, -12, 11]
print(order_by_points([]))  # []

def specialFilter(nums):
    count = 0
    for num in nums:
        if num > 10:
            str_num = str(num)
            if int(str_num[0]) % 2 != 0 and int(str_num[-1]) % 2 != 0:
                count += 1
    return count

def get_max_triples(n):
    a = [i * i - i + 1 for i in range(1, n + 1)]
    count = [0, 0, 0]
    for i in a:
        count[i % 3] += 1
    return count[0] * (count[0] - 1) * (count[0] - 2) // 6 + count[1] * count[2] * (count[2] - 1) // 2 + count[2] * count[1] * (count[1] - 1) // 2

def bf(planet1, planet2):
    planets = ["Mercury", "Venus", "Earth", "Mars", "Jupiter", "Saturn", "Uranus", "Neptune"]
    if planet1 not in planets or planet2 not in planets:
        return ()
    else:
        start = min(planets.index(planet1), planets.index(planet2))
        end = max(planets.index(planet1), planets.index(planet2))
        return tuple(planets[start+1:end])

def x_or_y(n, x, y):
    def is_prime(num):
        if num < 2:
            return False
        for i in range(2, int(num**0.5) + 1):
            if num % i == 0:
                return False
        return True

    if is_prime(n):
        return x
    else:
        return y

def Strongest_Extension(class_name, extensions):
    strongest_extension = extensions[0]
    max_strength = extensions[0].count(str.isupper) - extensions[0].count(str.islower)

    for extension in extensions[1:]:
        strength = extension.count(str.isupper) - extension.count(str.islower)
        if strength > max_strength:
            max_strength = strength
            strongest_extension = extension

    return class_name + '.' + strongest_extension

def even_odd_count(num):
    num = abs(num)  # convert to positive if negative
    num_str = str(num)  # convert to string to iterate over digits
    even_count = 0
    odd_count = 0
    for digit in num_str:
        if int(digit) % 2 == 0:
            even_count += 1
        else:
            odd_count += 1
    return (even_count, odd_count)

def find_max(words):
    max_unique_chars = 0
    max_word = ""
    for word in words:
        unique_chars = len(set(word))
        if unique_chars > max_unique_chars:
            max_unique_chars = unique_chars
            max_word = word
        elif unique_chars == max_unique_chars:
            if word < max_word:
                max_word = word
    return max_word

def eat(number, need, remaining):
    if remaining >= need:
        return [number + need, remaining - need]
    else:
        return [number + remaining, 0]

def do_algebra(operator, operand):
    # Initialize the result with the first operand
    result = operand[0]

    # Iterate over the operator list
    for i in range(len(operator)):
        # Perform the operation based on the operator
        if operator[i] == '+':
            result += operand[i+1]
        elif operator[i] == '-':
            result -= operand[i+1]
        elif operator[i] == '*':
            result *= operand[i+1]
        elif operator[i] == '//':
            result //= operand[i+1]
        elif operator[i] == '**':
            result **= operand[i+1]

    # Return the result
    return result

def solve(s):
    if not any(c.isalpha() for c in s):
        return s[::-1]
    else:
        return ''.join(c.lower() if c.isupper() else c.upper() for c in s)

import hashlib

def string_to_md5(text):
    """
    Given a string 'text', return its md5 hash equivalent string.
    If 'text' is an empty string, return None.

    >>> string_to_md5('Hello world') == '3e25960a79dbc69b674cd4ec67a72c62'
    """
    if text == '':
        return None
    else:
        return hashlib.md5(text.encode()).hexdigest()
